import React from 'react';
// import Myapp from './component/input_test';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Myapp from './component/input_test';
import Picture from './component/test';


function App(){
  return(
    <div>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={Picture}>

          <Route path="/input_test" element={Myapp} />

        </Route>
      </Routes>
    </BrowserRouter>
      <Picture/>

    </div>

  )
}
export default App;



